body:
@Afrogeek254 I also stumbled on this problem, and fixed it by changing python version. (Win10 x64)
Funny thing is that the first version I tried is the one "supported" by TF as said in [the documentation](https://www.tensorflow.org/install/install_windows#installing_with_native_pip) (used the link in the page for 3.6.x 64 which was 3.6.2).
Didn't want to find a workaround, and ended up installing 3.5.2 (also linked in the installation docs)
